import React from 'react';
import Avatar from '../Avatar/Avatar';

export default function CurrentUserComment(props) {
  return (
    <div>
      <div>
        <Avatar
          user={props.user}
          avatarSize="medium"
          alignment="toLeft"
          spaceLeft="spaceLeft"
        />
      </div>

      <div>
        <p> {props.comment} </p>
      </div>
    </div>
  );
}
